import React from 'react';
import ReactDOM from 'react-dom';

class Time extends React.Component {
	render() {
		return (
			<div style={{
				border: "8px solid",
				borderImage: "linear-gradient(-45deg,#743ad5,#d53a9d) 1"
			}}>
				Время:<br/>
				{new Date().toLocaleTimeString()}
			</div>
		)
	}
}

setInterval(() => {
		ReactDOM.render(
			<Time/>, document.getElementById('root')
		);
}, 1000
);
